    isOutlined?: boolean
};
// ...props = "Rest Operator", significa que tudo que nao for isOutlined e jogado dentro de ...props
export function Button ({isOutlined, }: ButtonProps) {
    return (
        <button className="button" {...props} /> //tecnica "spread operator" -> distribui as props do parametro para o botao
